INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("アヤネ", 0.0, 0.0, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2030/12/17 14:59:59", 401, 2, 0.0, 2, 102301, 24, 24001, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("アヤネ", 0.0, 0.0, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2030/12/17 14:59:59", 402, 1, 2.21, 2, 102301, 24, 24002, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("アヤネ", 0.0, 0.0, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2030/12/17 14:59:59", 403, 2, 0.0, 2, 102301, 24, 24003, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("アサヒ", 0.0, 0.0, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2030/12/17 14:59:59", 701, 2, 1.99, 1, 192201, 24, 24004, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("アサヒ", 0.0, 0.0, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2030/12/17 14:59:59", 702, 1, 2.21, 2, 192201, 24, 24005, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("アサヒ", 0.0, 0.0, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2030/12/17 14:59:59", 703, 2, 3.33, 1, 192201, 24, 24006, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("部員３", 0.0, 0.0, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2030/12/17 14:59:59", 801, 2, 0.0, 2, 192301, 24, 24007, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("部員３", 0.0, 0.0, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2030/12/17 14:59:59", 802, 1, 2.68, 2, 192301, 24, 24008, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("部員３", 0.0, 0.0, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2030/12/17 14:59:59", 803, 2, 0.0, 2, 192301, 24, 24009, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("", 0.0, 0.0, "2020/07/31 12:00:00", "やった！", "2030/12/17 14:59:59", 501, 1, 0.0, 1, 192501, 24, 24010, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("", 0.0, 0.0, "2020/07/31 12:00:00", "勝ったよ！", "2030/12/17 14:59:59", 502, 1, 0.0, 1, 192501, 24, 24011, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("", 0.0, 0.0, "2020/07/31 12:00:00", "いい調子！", "2030/12/17 14:59:59", 503, 1, 0.0, 1, 192501, 24, 24012, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ミサト", 0.0, 0.0, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2030/12/17 14:59:59", 111, 6, 5.33, 2, 113501, 24, 24013, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ミサト", 0.0, 0.0, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2030/12/17 14:59:59", 112, 1, 6.85, 2, 113501, 24, 24014, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ミサト", 0.0, 0.0, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2030/12/17 14:59:59", 113, 1, 3.0, 2, 113501, 24, 24015, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ダイチ", 0.0, 0.0, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2030/12/17 14:59:59", 611, 1, 6.11, 2, 192401, 24, 24016, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ダイチ", 0.0, 0.0, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2030/12/17 14:59:59", 612, 1, 6.75, 2, 192401, 24, 24017, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ダイチ", 0.0, 0.0, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2030/12/17 14:59:59", 613, 2, 0.0, 2, 192401, 24, 24018, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ハツネ", 0.0, 0.0, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2030/12/17 14:59:59", 211, 2, 4.52, 1, 113401, 24, 24019, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ハツネ", 0.0, 0.0, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2030/12/17 14:59:59", 212, 2, 3.89, 1, 113401, 24, 24020, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ハツネ", 0.0, 0.0, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2030/12/17 14:59:59", 213, 1, 13.49, 2, 113401, 24, 24021, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("カヤ", 0.0, 0.0, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2030/12/17 14:59:59", 311, 1, 3.17, 2, 106501, 24, 24022, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("カヤ", 0.0, 0.0, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2030/12/17 14:59:59", 312, 1, 4.42, 2, 106501, 24, 24023, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("カヤ", 0.0, 0.0, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2030/12/17 14:59:59", 313, 6, 2.89, 1, 106501, 24, 24024, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("アヤネ", 0.0, 0.0, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2030/12/17 14:59:59", 421, 4, 3.71, 3, 102301, 24, 24025, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("アサヒ", 0.0, 0.0, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2030/12/17 14:59:59", 721, 2, 5.1, 1, 192201, 24, 24026, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("部員３", 0.0, 0.0, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2030/12/17 14:59:59", 821, 1, 4.34, 3, 192301, 24, 24027, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("", 0.0, 0.0, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", "2030/12/17 14:59:59", 521, 1, 0.0, 1, 192501, 24, 24028, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ミサト", -360.0, 0.0, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2030/12/17 14:59:59", 101, 1, 5.62, 2, 113501, 24, 24029, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ミサト", -360.0, 0.0, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2030/12/17 14:59:59", 102, 1, 9.58, 2, 113501, 24, 24030, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ミサト", -360.0, 0.0, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2030/12/17 14:59:59", 103, 2, 0.0, 2, 113501, 24, 24031, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ミサト", -360.0, 0.0, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2030/12/17 14:59:59", 104, 2, 9.13, 1, 113501, 24, 24032, 10046);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES ("ミサト", -360.0, 0.0, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2030/12/17 14:59:59", 105, 1, 8.27, 2, 113501, 24, 24033, 10046);
